    true,nt"url": null,nt"notes": "In this study, modeled gas- and aerosol
    phase ammonia, nitric acid, and hydrogen chloride are compared to measurements taken
    during a field campaign conducted in northern Colorado in February and March 2011.
     We compare the modeled and observed gas-particle partitioning, and assess potential
    reasons for discrepancies between the model and measurements.  This data set contains
    scripts and data used for each figure in the associated manuscript.  Figures are
    generated using the R project statistical programming language. Data files are in
    either comma-separated value (CSV) format or netCDF, a standard self-describing
    binary data format commonly used in the earth and atmospheric sciences.  nnThis
    dataset is associated with the following publication:nKelly , J., K. Baker , C.
    Nolte, S. Napelenok , W.C. Keene, and A.A.P. Pszenny. Simulating the phase partitioning
